(51, 3, 'Jordan Profile', 'Agent and Broker', 'Active', 'Jordan', 'Cachero', 'CCW Company', 'Sample Slogan', '09261000883', 'jrdncchr@gmail.com', 'http://www.genuinecore.com/jordan/blog/contact', 'Very Good Person.|Very Happy Person.|Very Cool Person.|Very Awesome Person.|Very Talented Person.|Very Crazy Person.|7|8|9|10|', 'I am a web developer...', '2013', 'http://www.sample.com/free', 'http://www.sample.com/all', 'http://www.ccw.com/', 'Jasper Pangulayan', 'Somewhere in Baguio', '0988293123', '008', 'http://www.listing-book.com/jrdncchr', 'http://www.facebook.com/jrdncchr', 'http://www.twitter.com/jrdncchr', 'http://www.linkedin.com/jrdncchr', 'http://www.youtube.com/jrdncchr', '{"image1":"http:\\/\\/localhost\\/leadgeneratortool\\/resources\\/others\\/uploads\\/php\\/files\\/c839d22a625b824c9284689891555016.JPG","image2":"http:\\/\\/localhost\\/leadgeneratortool\\/resources\\/others\\/uploads\\/php\\/files\\/cac57d0a457db73c9f520f77a7dc555f.jpg","image3":"http:\\/\\/localhost\\/leadgeneratortool\\/resources\\/images\\/img-placeholder.png","text":"Owner Images"}', '{"image1":"http:\\/\\/localhost\\/leadgeneratortool\\/resources\\/others\\/uploads\\/php\\/files\\/b3fbf3a134e96aefe78a5bf589771fd6.png","image2":"http:\\/\\/localhost\\/leadgeneratortool\\/resources\\/others\\/uploads\\/php\\/files\\/10bc00d137f10c21245baf98c05a7854.png","image3":"http:\\/\\/localhost\\/leadgeneratortool\\/resources\\/images\\/img-placeholder.png","text":"Logo Images"}', '2014-02-24 08:55:45'),
(52, 3, 'Hunter X Hunter', 'Agent and Broker', 'Active', 'Gon', 'Freecs', 'Hunters Guild', 'Hunter Slogan', '0926100885', 'hxh@gmail.com', 'http://www.hunterxhunter.com', 'Gon is awseomely amazing.|Son of Jin|||||||||', 'Hunter Gon son of Hunter Jin', '2013', 'http://www.freesearch.com', 'http://www.alllistings.com', 'http://www.company.com', 'Killua', 'Zoldick', '09261000994', '002', '', '', '', '', '', '', '', '2014-03-10 17:16:00'),
(53, 5, 'Mike Cribbin', 'Agent and Broker', 'Active', 'Mike', 'Cribbin', 'Cribbin Realty', 'Where Performance Outsells Promises', '(314) 954-6500', 'mike@cribbinrealty.com', 'http://cribbinrealty.com/contact/', 'Mike Cribbin has earned my trust and highest recommendation as a realtor. Until I hired Mike to sell my property, my home sat on the market for months and months without a bid. Mike employed a variety of marketing techniques and within weeks he got a proposal that eventually turned into a sale. -  Thanks Mike ~ Sue and Mark|The reason I agreed to write this is because you amazed me. I had my home listed for over 1 year with 2 different realtors. I was hesitant to use you because you were not with a BIG company. Well as the story goes you listed my home and in 4 days we had an accepted contract. You are the BEST I have ever seen. ~ Terri McMillian|I know you had to be very patient with us because we didn''t know what we were looking for in a new home. After answering all of you questions we were able to narrow it down and find the perfect home for us. thanks for spending so much time listening and showing us homes. ~ Ralph and Virgina Wells|Just want to thank you for all your help, guidance and support in this most stressful time of buying my home. You took command and orchestrated the situation with such ease. Your professionalism and knowledge of real estate as well as incorporating "new technology" was very much respected and appreciated. I could not have done this without you!!!!!!!!! ~ Brad|||||||', 'With over 30+ years of experience I have seen many different real estate climates.  For expert advise whether you are buying or selling a property in the current real estate environment contact me today! ', '1977', 'http://search.cribbinrealty.com/idx/17504/advancedSearch.php', 'http://cribbinrealty.com/', 'http://cribbinrealty.com/', 'Cribbin Realty', '3112 Brook Hollow, O''fallon MO 63366', '(636) 294-6061', 'MO Real Estate Broker # 1999012699', '', '', '', '', '', '', '', '2014-03-22 18:26:57'),
(54, 8, 'Mike Cribbin', 'Agent and Broker', 'Active', 'Mike', 'Cribbin', 'Cribbin Realty', 'Where Performance Outsells Promises', '(314) 954-6500', 'mike@cribbinrealty.com', 'http://cribbinrealty.com/contact', 'I know you had to be very patient with us because we didn''t know what we were looking for in a new home. After answering all of you questions we were able to narrow it down and find the perfect home for us. thanks for spending so much time listening and showing us homes.  ~ Ralph and Virgina Wells|The reason I agreed to write this is because you amazed me. I had my home listed for over 1 year with 2 different realtors. I was hesitant to use you because you were not with a BIG company. Well as the story goes you listed my home and in 4 days we had an accepted contract. You are the BEST I have ever seen.  ~ Terri McMillian|Great job marketing & Selling our house Mike! Contract in 17 days, closed 30 days later... WOW... You are the man!  ~ Kirk and Jennifer|Mike Cribbin made being a first time home buyer a great experience. I would recommend Mike to anyone who is even thinking of buying or selling a house! ~  Jessica and Drew Elwell|You have made my life bearable again getting me out from under this house. I didn''t really expect to sell in 4 days, but thanks. I will recommend you to anyone just have them call me. Now lets get me a new home.  ~  Steve Kline|Thanks for helping us negotiate a great deal on our new home. Without some your advice and keeping us patient I know we would have over paid. You are one calm person, never letting anything get you rattled. I thought your flinching technique was funny at first, but it worked. ~  Jim and Karlee Michaels|After being on the market with another real estate company for 6 months, you listed my home and sold it in 3 days.  This was not someone who had already seen the home it was someone you found to come and look at my house.  I don''t know what you did or how you did it, but I will refer you to EVERYONE I know. ~ Crystal Andersen|This is fun to write because you sold my house in 3 days and had multiple offers.  I got $5,600 more than list price.  Your are great.  I will be referring you to all my friends and family.  Mike, you Rock!!!  ~ Sara Huntley|Thanks for showing me the home I requested and then walking me through the entire buying process.  I don''t know what I would have done without.  You are a very patient man.  My mom and dad will be selling their home soon, they are also going to use you. ~ Ashley Deilman|I want everyone to know that Mike did an awesome job selling my home.  He sold it in 1 day.  When he called me I thought he had more questions to ask about the home.  I wouldn''t have dreamed that he had a firm cash offer for my house in just 1 day.  THANKS! ~  James and Ruth Cummings|', 'With over 30+ years of experience, I can help you whether you are buying your dream home or selling your next property.  The real estate environment is constantly changing and I been through most of the different cycles in the market.', '1977', 'http://search.cribbinrealty.com/idx/17504/advancedSearch.php', 'http://cribbinrealty.com', 'http://cribbinrealty.com/', 'Cribbin Realty', '3112 Brook Hollow, O''fallon MO 63366', '(636) 294-6061', 'MO Real Estate Broker # 1999012699', '', 'http://www.facebook.com/pages/Cribbin-Realty/117201826589', 'https://twitter.com/CribbinRealty', '', 'https://www.youtube.com/user/CribbinRealty', '', '', '2014-04-02 05:35:37'),
(55, 9, 'Jasper Pangulayan', 'Agent and Broker', 'Active', 'Jasper', 'Pangulayan', 'CCW', 'Sample', '5566', 'jasper@gmail.com', 'http://www.sample.com', 't1|t2|t3|t4|t5|t6|t7|t8|t9|t10|', 'Sample About', '2013', 'http://www.free.com', 'http://www.all.com', 'http://sample.com', 'broker name', 'broker@gmail.com', 'broker phone', '512', '', '', '', '', '', '', '', '2014-04-08 03:43:35'),
(56, 28, 'rogerhayer', 'Agent and Broker', 'Active', 'Roger & Rosie', 'Hayer', 'Keller Williams', 'Your satisfaction is my success!', '512-796-9395', 'rogerhayer@gmail.com', 'http://rosiehayer.kwrealty.com/', 'I have been most impressed with Roger''s patience and professionalism in helping to bring the sale of my home to a quick and successful conclusion. Clearly, not all real estate agents are created equal. I''m glad we had selected Roger and his company. - Maan Family Austin, TX|Great job! What a relief. Thank you very much for being so patient and willing to work with us during the sale of the house. Erika and I really appreciate all your hard work. You got us the record high sale price for our house. - Gonzales Family Round Rock, TX|Rosie and Roger, just wanted to drop you a note to say thank you for selling our house so quickly. We are very happy in our new place. Please come and visit sometime. - Kevin Andrew Austin, TX|We loved Rosie''s enthusiasm and professionalism. My house was on the market for over 6 months and never sold. When I decided to work with Rosie, she stayed on top of the market and showings poured in when she listed. She sold our house and negotiated a great price for us. She is very honest and looked for our interest at all times. - Mesuria Family Austin, TX|||||||', 'As an agent who''s an expert in this local area, I bring a wealth of knowledge and expertise about buying and selling real estate here. It''s not the same everywhere, so you need someone you can trust for up-to-date information.\n\nI am licensed to do business in the state of Texas by the Texas Real Estate Commission - License (Roger #586306) (Rosie #622318). Texas law requires all real estate licensees to give the following information about brokerage services: http://www.trec.state.tx.us/pdf/contracts/OP-K.pdf', '2008', 'http://rosiehayer.kwrealty.com/', 'http://rosiehayer.kwrealty.com/', 'http://rosiehayer.kwrealty.com/', 'Keller Williams', '12515-8 Research Blvd. Suite 100 Austin, TX 78759', '(512) 346-3550', '492214', '', 'https://www.facebook.com/teamhayer1', '', '', 'https://www.youtube.com/channel/UCkQ0pRVN34T0k_7McIfhvng', '', '', '2014-08-13 09:42:15'),
(57, 29, 'Michelle', 'Agent and Broker', 'Active', 'Michelle', 'Yang', 'CCW', 'Slogan', '093283', 'miche@gmail.com', 'http://webpage.com', 'testimonial1|testimonial2|testimonial3|testimonial4|testimonial5|testimonial6|testimonial7|testimonial8|testimonial9|testimonial10|', 'Sexy', '2011', 'http://www.link2freesearch.com', 'http://www.alllistings.com', 'http://company.com', 'Jaryl Segubience', 'Baguio', '0394948', '33', 'http://www.lisitng.com', 'http://www.fb.com', 'http://www.twitter.com', 'http://www.linkedin.com', 'http://www.yt.com', '', '', '2014-08-13 20:01:05'),
(58, 30, 'Dan Raymer', 'Agent and Broker', 'Active', 'Dan', 'Raymer', 'Guarantee Real Estate', 'Results That Move You', '559 355 7756', 'dtraymer@gmail.com', 'http://www.GreatHomesInFresno.com', 'K. Wright- I highly recommend Dan Raymer, as an agent in and around the Fresno, CA area. I found him to be very knowledgeable regarding the sale of homes in the area. He was always prompt with any information that I needed, and kept me up to date on matters concerning the sale. My house sold quickly and I give the credit to Dan, as an excellent agent. I found him to be honest and a man of integrity. I have already recommended him to friends.|M. Hensley- I recommended Dan''s services to a close family friend. He was very professional, but most importantly was very caring towards my friend''s needs. He communicated frequently and walked her through the sale of her home with confidence. I would recommend him to future friends & clients knowing that they will be in good hands.|Kathy and Dave- We loved working with Dan! We bought a great house in just the neighborhood we wanted. He was patient, informed, and professional throughout our entire experience. We would definitely recommend him to friends and family who need a reliable and knowledgeable real estate agent.|Steve and Carol- We have had the privilege of being both buyers and sellers through Dan. He is the most responsive agent we have ever worked with. His knowledge is top notch. When we sold through him, his advise was spot on. When we bought through him, he knew our wants and desires and he worked to make sure we got them. Our needs are a bit more complicated than the average client -- we are out of town clients. Dan made every effort to make our transactions as easy as possible. I can not say enough good about our experiences with Dan. I whole-heartedly recommend him for your real estate needs.|The Crockers- Our experience with Dan Raymer was very positive. We listed our home with Dan and he guided us through every detail along the way. Dan was knowledgeable when we had questions. He did a beautiful job displaying our home on the website and getting it sold in record time. What I liked about Dan is his honesty and integrity. Dan is now our Realtor and I recommend him to you.|Ian Vandrick- Dan was great. He made our house shopping experience enjoyable. Dan always was super prompt in replying to any questions we had, responding to emails, or any other correspondence we had with him. When we found our house, he helped us through the paper work and made that process as easy as possible. We really enjoyed working with Dan. When it came time for my mom to sell her house, we heartily recommended Dan to her. He did a great job helping my mom sell her house. My mom was very pleased with him.|G. Donan- Dan Raymer is a great realtor, very prompt and professional. He quickly answered emails, texts and phone calls. He exceeded my expectations. I have rarely experienced such quick response time with other professionals. I thank him for all his assistance and professional advise to find the right investment properties. He is very knowledgeable, honest and patient. I highly recommend Dan for all your real estate needs and definitely plan to use him again in the future.|Anthony Bonilla- Dan Raymer was an excellent realtor through the stressful process of buying a home. He was very patient in making sure that the homes he sought after would be homes that we would consider and had the things we wanted. He even offered his own opinions on certain homes and was not hesitant to advise us against something he didn''t see would benefit us. The best part of his efforts is that there wasn''t a question he wouldn''t answer. He would provide us with the best information we needed. Even now, six months after moving in he is more than happy to answer any questions that arise! Professional, patient, and passionate. If you''re in search of a new home, don''t look any further!|Tess F.- We bought our 1st house w/ Dan''s help. He is very hardworking, patient and always available to answer our questions. We would definitely recommend him to our friends and family!|David and Rocio Ribb- “My wife and I had been searching for a house off and on for a few years. We had tried a few other Realtors, but they always showed us what they thought they could get us into not what we wanted. Dan was the first Realtor to actually listen to our wants and needs. He always asked us to rate the houses after we saw them (1 -10). Toward the end of our search, not only was he emailing and showing us houses we’d like, but he could guess both our ratings pretty accurately which confirmed to us he heard what we wanted in a house. When we finally chose our house, (a short sale), Dan worked very hard to help us. Even with the bumps in the road he kept helping and went the extra mile to make sure we got the house we wanted. We are very thankful and blessed to have met Dan. Without his help we would not be in the house we love.|', 'Dan Raymer offers unparalleled service to ALL clients in the Fresno Area, California real estate market. Your complete satisfaction with our service and representation is our number one priority.\n\nDan serves the entire Fresno, California real estate market including the surrounding communities such as Clovis, Hanford, Kerman, Kingsburg, Madera, Reedley, Parlier, Sanger, Selma, and Visalia areas.\n\nWhether you are considering buying a home, selling a home or both, we know this area inside and out.\n', '2004', 'http://www.findfresnoareahomes.com/', '', 'http://www.GreatHomesInFresno.com', 'Dan Raymer', '3 RiverPark Place East', '559-355-7756', '01461039', '', 'http://www.facebook.com/dtraymer', 'https://twitter.com/dtraymer', '', 'https://www.youtube.com/user/danraymer', '', '', '2014-08-21 08:43:07'),
