(11, 54, '3 Overlook Place', 'Winfield', 'Winfield', 'Winfield', 'MO', 'Missouri', '63389', 'United States', 'Lincoln County', 'Residential Home', 'WINFIELD’S BEST!!\n\nThis amazing 3 bed 3 bath split level with over-sized garage is priced to sell and is move-in ready!\n\nFeaturing over 1500 square feet of living space and located on a quiet cul-de-sac in the Whitehawk Estates subdivision. This incredible home – with 12 X 12 deck with steps and walkout basement- features a great room, dining room and kitchen with vaulted ceilings, plant shelves, white 6 panel doors throughout, nickel hardware, 2 inch faux blinds, ceiling fans in all bedrooms and great room, closet organizer in the master bedroom, and contemporary lighting fixtures.\n\nThe kitchen includes a beautifully tiled backsplash, new flooring, sink filtration, a peninsula w/ breakfast bar, pantry, electric stove, microwave, dishwasher, and garbage disposal.\n\nThe lower level boasts a professionally finished family room and full bath. Exterior features include: newer landscaping, 12 X 12 patio, maintenance free vinyl siding, soffits and fascia.\n\nThis home is a definite must see!', '14018921', 'Amazing 3 bed / 3 bath split level|Located on a quiet cul-de-sac in Whitehawk Estates subdivision|Professionally finished lower level with family room and full bath|12 X  12 Deck with steps to back yard|12 X 12 Patio off the finished lower level|Vaulted ceilings in the great room, kitchen and dining room|Oversized garage|Ceiling fans in all bedrooms and great room|Kitchen includes a beautifully tiled backsplash, new flooring, sink filtration|Breakfast bar for snacks and quick meals|', '3', '3', '1,500', 2006, '9,104 Sq Ft', 'http://cribbinrealty.com/listings/3-overlook-place/', 'Troy R-III', 'Troy Buchanan High School', 'Troy Middle School', 'Wm. R. Cappel Elementary School', 'US-61 N to Troy/Winfield Exit\nRight onto Hwy 47 (6.1 miles)\nLEFT onto Missouri W (0.2 miles)\n1st LEFT onto Grayhawk Dr (492 ft)\nRIGHT onto Overlook PL (154 ft)\nHome on LEFT', 'http://cribbinrealty.com/listings/3-overlook-place/', '', 'For Sale', 'Homes', 'Real Estate', '3 Bedroom|Cul-De-Sac|Split Level|', 'Homes For Sale in Winfield|3 Bedroom Homes For Sale in Winfield|Cul-De-Sac Homes For Sale in Winfield|Split Level Homes For Sale in Winfield|3 Bedroom Cul-De-Sac Homes For Sale in Winfield|3 Bedroom Split Level Homes For Sale in Winfield|Cul-De-Sac Split Level Homes For Sale in Winfield|Real Estate For Sale in Winfield|3 Bedroom Real Estate For Sale in Winfield|Cul-De-Sac Real Estate For Sale in Winfield|Split Level Real Estate For Sale in Winfield|3 Bedroom Cul-De-Sac Real Estate For Sale in Winfield|3 Bedroom Split Level Real Estate For Sale in Winfield|Cul-De-Sac Split Level Real Estate For Sale in Winfield|3 Overlook Place|3 Overlook Place Winfield|3 Overlook Place Winfield MO|3 Overlook Place Winfield MO 63389|', 'true', '2014-04-18 05:51:57'),
(12, 54, '352 Brookhaven Dr', 'O''fallon', 'Ofallon', 'O Fallon', 'MO', 'Missouri', '63368', 'United States', 'St Charles County', 'Residential Home', 'If you are looking for a home in Francis Howell school district or John Weldon elementary school you won’t believe this home, it is fantastic.\n\nThis ranch home features a corner lot, 4 bedrooms, 3 baths and an open floor plan.\n\nMain floor features an open concept, wood burning fireplace in the vaulted great room, laundry room off kitchen, dining room and kitchen with ceramic tile, oak cabinets, and lots of counter space.\n\nThe master bedroom opens with double doors, walk in closet, Master bath has double bowls, separate tub and shower.\n\nNow the Lower Level is a walkout with a large rec room, full bath and bedroom again with double door entry.\n\nThe exterior has a beautiful deck right off the dining room overlooking a level yard and backing to common ground and large patio. Convenient location just minutes from Hwy 40.\n\nBe careful with this listing, if you see it you will buy it.', '14018321', 'Ranch home on corner lot|Vaulted great room with wood burning fireplace|Main floor laundry right off the kitchen|Master bath has double bowls, separate tub and shower|Master bedroom has nice walk-in closet|Oak cabinet kitchen with ceramic tile and lots of counter space|Lower level is a walkout with a large recreational room|Full bath and bedroom in the lower level|Beautiful deck right off the dining room overlooking a level back yard|Property backs to common ground for the kids to play|', '4', '3', '2,550', 2001, '0.27 acres', 'http://cribbinrealty.com/listings/352-brookhaven-dr/', 'Francis Howell R-III', 'Francis Howell High School', 'Francis Howell Middle School', 'John Weldon Elementary School', 'From I-64 take State Hwy K \nGo LEFT on Weldon Springs Rd\nTurn LEFT onto Brookhaven Dr\nHome on LEFT', 'http://cribbinrealty.com/listings/352-brookhaven-dr/', 'http://cribbinrealty.com/ofallon-homes-for-sale/', 'For Sale'