(13, 54, '4162 Hopewell Rd', 'Wentzville', 'Wentzville', 'Wentzville', 'MO', 'Missouri', '63385', 'United States', 'Saint Charles county', 'Residential Home And Land', '3.4 Acres of mostly trees. Looking for a Fixer - Upper??\n\nUpdates include Roof 2012, the windows were replaced in 2000, air conditioner & furnace in 2010 and the water heater was replaced in November of 2011.\n\nThe attached structure to the left of the main house was an original two room hunting lodge that has a wood burning fireplace in it.\n\nProperty with mature trees. 3 bedroom and 2 bath home being sold as is . This can be your home away from home or a nice investment for you to build your dream home.\n\nJust minutes from everything and just minutes from some of the most elegant homes in St. Charles County - many new developments of luxury homes as well as estate homes, and gorgeous horse property all around.\n\nIncredible setting that is mostly wooded and private, with a ranch/manufactured home. Parcels with this acreage alone sold at this price or above.\n\nCall today for a showing.', '14019640', '3.4 Acres of mostly trees|Could be a potential teardown in this area|Can be your home away from home|Nice investment property to build a dream home on|Just minutes from everything|Gorgeous horse property all around|Incredible setting and very private|Close to elegant homes|New roof in 2012|New HVAC in 2010|', '3', '2 Full', '1,368 Sq Ft', 1974, '3.4 acres', 'http://cribbinrealty.com/listings/4162-hopewell-rd/', 'Wentzville R-IV', 'Timberland High School', 'Wentzville South Middle School', 'Daniel Boone Elementary', 'From I-64 take Hwy DD south\nTurn LEFT onto Schwede Rd\nTurn LEFT onto Hopewell Rd\nHome on RIGHT', 'http://cribbinrealty.com/listings/4162-hopewell-rd/', 'http://cribbinrealty.com/wentzville-homes-for-sale/', 'For Sale', 'Homes', 'Properties', 'Fixer Upper|3 Bed|Ranch|', 'Homes For Sale in Wentzville|Fixer Upper Homes For Sale in Wentzville|3 Bed Homes For Sale in Wentzville|Ranch Homes For Sale in Wentzville|Fixer Upper 3 Bed Homes For Sale in Wentzville|Fixer Upper Ranch Homes For Sale in Wentzville|3 Bed Ranch Homes For Sale in Wentzville|Properties For Sale in Wentzville|Fixer Upper Properties For Sale in Wentzville|3 Bed Properties For Sale in Wentzville|Ranch Properties For Sale in Wentzville|Fixer Upper 3 Bed Properties For Sale in Wentzville|Fixer Upper Ranch Properties For Sale in Wentzville|3 Bed Ranch Properties For Sale in Wentzville|4162 Hopewell Rd|4162 Hopewell Rd Wentzville|4162 Hopewell Rd Wentzville MO|4162 Hopewell Rd Wentzville MO 63385|', 'true', '2014-04-21 14:16:04'),
(14, 54, '3667 Taylor Ave', 'Bridgeton', 'Bridgeton', 'Bridgeton', 'MO', 'Missouri', '63044', 'United States', 'St Louis County', 'Residential House', 'This stylish 4 Bedroom split foyer home offers the best in features, price and location, not to mention large rooms and closets.\n\nLocated at the end of a quiet no-through street, this home has been extensively updated (roof, insulation, flooring, windows, siding, doors, fixtures, wiring, plumbing, etc) remolding was done with great care & attention to detail, it is immaculately clean & has jet tub. Beautiful wood floors throughout. Two large brick fireplaces.\n\nUpdated kitchen, back splash, appliances & pantry. Two story enclosed porch and deck off of Breakfast Room. Separate Dining room. Plenty of windows letting in lots of natural light.\n\nPartially finished, walk-out lower level, with the interior wheelchair lift/elevator in the enclosed two story porch, this home is wheelchair accessible. Over-sized two car garage, high efficiency furnace.\n\nThis home is nearly new and sits on 1/2 acre lot in an established neighborhood.\n\nCome and see this wonderful home in the Pattonville school district.', '14019294', 'Amazing 4 bedroom split foyer|Located at the end of a quiet no-thru street|Extensively updated - roof, insulation, flooring, windows, siding, doors, etc...|Immaculately clean|Jetted tub and separate shower|2 large brick fireplaces|Updated kitchen with backsplash, appliances, and pantry|2 story enclosed porch and deck off of breakfast room|Wheelchair accessible home|Oversized 2 car garage|', '4', '2 Full', '2,686 Sq Ft', 1974, '0.56 Acres', 'http://cribbinrealty.com/listings/3667-taylor-ave/', 'Pattonville R-III', 'Pattonville Senior High School', 'Pattonville Heights Middle School', 'Bridgeway Elementary', 'N Lindbergh to WEST on Old Saint Charles Rd\nRIGHT onto Taylor Ave\nHome LEFT', 'http://cribbinrealty.com/listings/3667-taylor-ave/', '', 'For Sale', 'Homes', 'Real Estate', 'Wheelchair Accessible|Split