(15, 54, '8 Piepers Glen', 'O''fallon', 'Ofallon', 'O Fallon', 'MO', 'Missouri', '63366', 'United States', 'St Charles County', 'Residential Villa', 'Welcome to a truly lovely villa in popular Piepers Glen subdivision.\n\nThis Villa features 3 bedrooms-3 Full Baths, hardwood foyer with open staircase to finished lower level.\n\nLower level has a 25 x 24 family room with snack bar, marble hearth gas fireplace, 3rd bedroom & full bath.\n\nThe main floor features include a vaulted 15 x 24 great room with a marble gas fireplace. Large dining room area, kitchen and breakfast rooms are spacious and well appointed with smooth top electric range, pantry, wood cabinetry and a door which walks out to awesome deck with a view of the back yard.\n\nThe 19 x 14 master bedroom includes walk-in closet and ceiling fan. The master bath has a double vanity separate tub & shower. Other bedrooms are spacious & tastefully decorated.\n\nAdditional features include main floor laundry with cabinets & shelving, finished 2 car garage, bay windows, 3 recessed windows in Lower Level, work shop in Lower Level with built-in work space & plenty of storage.\n\nThere are too many upgrades to mention, call for list.', '14020377', 'Hardwood foyer with open staircase|Finished lower level|Vaulted 15X25 great room with marble gas fireplace|Awesome deck with view of the back yard|Large dining room|Spacious kitchen and breakfast room|Main floor laundry with cabinets and shelving|Finished 2 car garage|Work shop in lower level with built in work space and storage|19X14  Master bedroom includes walk-in closet and ceiling fan|', '3', '3 full', '2,325', 0000, '-', 'http://cribbinrealty.com/listings/8-piepers-glen/', 'Fort Zumwalt ', 'Fort Zumwalt North High', 'Fort Zumwalt North Middle', 'Westhoff Elementary', 'I70 to N Main St/Hwy K Exit\nGo North on N Main St\nLEFT onto Tom Ginnever Ave\nLEFT onto Piepers Glen Ln\nRIGHT onto Piepers Glen Ct\nHome on RIGHT', 'http://cribbinrealty.com/listings/8-piepers-glen/',