(18, 54, '13354 Klausmeier', 'Wright City', 'Wright City', 'Wright City', 'MO', 'Missouri', '63390', 'United States', 'Warren county', 'Residential Home And Land', 'REASONABLE OFFERS ACCEPTED****\n\nBring your family, friends & horses to this unique country home, located in White Oak Lake Estates only 5 minutes from I-70.\n\nThe custom built home boasts 2,720 square feet on the main level plus 1,900 square feet in lower level with 9 foot ceilings.\n\nCurrently used as a horse layover for folks traveling, this home offers 4 bedrooms, 4.5 baths, all nestled on 12.5 acres (2 deeds) with lots of trees, pond and a beautiful lake. 3 gas fireplaces, 3 car garage plus a 44×88 metal horse barn with 10 stalls and a small tack room. No frost water for the horses in the winter and more than 3,000 feet of white vinyl horse fencing.\n\n68 foot long deck in the rear of the house with matching concrete patio below. Above ground pool and hot tub with gazebo.\n\nThe owner’s suite has a 2 person jetted tub, 3 sided fireplace and 2 walk-in closets.\n\nThe country kitchen is the place to cook up a storm with double convection ovens, large center island and large pantry, home warranty, security system, and more. You will be impressed!', '14010285', 'Custom built home with over 4,600 square foot finished|Horse and family friendly|12.5 acres of ground with many trees|Beautiful lake and separate pond|44x88 foot metal horse barn with 10 stalls and tack room|3,000 feet of white vinyl horse fencing|68 foot long deck with matching patio below|Master bath has 2 person jetted tub and 3 sided fireplace|Country kitchen has large center island and large pantry|Above ground pool and hot tub|', '5', '4.5', '4,620 Sq Ft', 2003, '12.5 Acres', 'http://cribbinrealty.com/listings/13354-klausmeier-horse-farm-for-sale-in-wright-city/', 'Wright City R-II', 'Wright City High', 'Wright City Middle', 'Wright City West Elementary', 'Hwy 70 West to Wright City 2nd exit, \nGo Left (West) on the North Service Road\n