(32, 54, '21933 Pike 215', 'Annada', 'Annada', 'Annada', 'MO', 'Missouri', '63330', 'United States', 'Pike County', 'Residential Home And Land', 'This beautiful atrium ranch with 2,961 finished SQ FT.\n\nIncludes walkout, finished lower level, and is situated on 6.1 acres!\n\nYou will find 4 bedrooms, 3.5 baths open floor plan with a vaulted atrium. The kitchen is beautiful complete with custom cabinetry, tile counter top & stainless appliances.\n\nA formal dining room, breakfast room and split bedroom plan are found in this home.  The master bedroom suite has private deck and walk in closet along with a  master bath that has double sinks, separate jetted tub and shower.  There are 2 additional bedrooms off kitchen with hall bath & private shower and toilet room.\n\nLaundry is large with slop sink and access to half bath.\n\nThe finished walk out lower level has a recreation area, family room, wet bar & patio that walks out to the above ground pool. An additional bedroom & bath in the lower level is perfect for guests or an in law suite.\n\nAlso found is a large storage area, two hot water heaters, over-sized 2 car garage with side entry, and much more.', '14047280', 'Sits on 6.1 Acres|4 bedroom / 3.5 baths with open floor plan|Kitchen is beautiful complete with custom cabinetry, tile counter, and stainless appliances|Master bedroom suite has private deck and walk-in closet|Master bath features double sinks, sparate jetted tub and shower|Large laundry room with slop sink|Finished lower level has family room, recreation room, and wet bar|Oversized 2 car garage with side entry|Backyard features patio and swimming pool|Beautiful atrium ranch|', '4', '3 full / 1 half', '2,961', 2004, '6.1 acres', 'http://cribbinrealty.com/listings/21933-pike-215-atrium-ranch/', 'Pike Co. R-111', 'Clopton High School', 'Clopton Middle School at the High School', 'Clopton Elementary', '61 North to Eolia Exit \nturn right to Hwy H to Paynesville \nRight on W to \nLeft on Hwy H to \nLeft on Pike 215 to\nhome on Right. \nOR HWY 70 to Hwy 79 to \nleft on Hwy H to \nRight on Pike 215, \nhome on Right.\n', 'http://cribbinrealty.com/listings/21933-pike-215-atrium-ranch/', '', 'For Sale', 'Homes', 'Property', 'Atrium Ranch|4 Bedroom|Single Family|', 'Homes For Sale in Annada|Atrium Ranch Homes For Sale in Annada|4 Bedroom Homes For Sale in Annada|Single Family Homes For Sale in Annada|Atrium Ranch 4 Bedroom Homes For Sale in 63330|Atrium Ranch Single Family Homes For Sale in 63330|4 Bedroom Single Family Homes For Sale in Annada|Property For Sale in Annada|Atrium Ranch Property For Sale in Annada|4 Bedroom Property For Sale in Annada|Single Family Property For Sale in Annada|Atrium Ranch 4 Bedroom Property For Sale in 63330|Atrium Ranch Single Family Property For Sale in 63330|4 Bedroom Single Family Property For Sale in Annada|21933 Pike 215|21933 Pike 215 Annada|21933 Pike 215 Annada MO|21933 Pike 215 Annada MO 63330|', 'true', '2014-08-22 07:21:25'),
(33, 58, '1120 E. Carnoustie Ave', 'Fresno', 'Fresno', 'Fresno', 'CA', 'California', '93730', 'United States', 'Woodward Park Area', 'Residential Home', 'Traditional Sale! Popular 2000 square foot model in the desirable Brentwood on the Green development. Beautiful hardwood flooring, kitchen with granite, stainless appliances and bar top seating. Open and airy great room with surround sound featuring premium Klipsch speakers and gas fireplace with stone trim. Den off of Master Suite would be a great office space or extra living area. Plantation shutters in the front windows. Nice, open covered patio with plenty of room for entertaining. Trails and parks nearby. Close to Copper River and Fort Washington golf courses.', '429734', 'Clovis Schools|Granite Kitchen Stainless w/ Stainless Appliances|Beautiful Hardwood Flooring|Bartop Seating|Surround with Premium Klipsch Speakers|Office|Plantation Shutters|Trails and Parks Nearby|Nice Open Covered Patio|Glose to Copper River and Ft. Washington Golf Courses|', '3', '2', '2000', 2005, '7,812', 'http://www.greathomesinfresno.com/property/1120-E-Carnoustie-Ave-Fresno-California', 'Clovis Unified School District', 'Clovis North', 'Granite Ridge', 'Fugman', 'From Copper and Millbrook, South on Millbrook, Right on Hogan, Right on Bunker Hill to Carnoustie.', 'https://www.google.com/maps/place/1120+E+Carnoustie+Ave,+Fresno,+CA+93730/@36.895272,-119.763053,17z/data=!3m1!4b1!4m2!3m1!1s0x809442422c5ffed1:0xd86fda5974628347?hl=en', 'http://www.greathomesinfresno.com/property/11346-N-Via-Ventana-Way-Fresno-California', 'For Sale', 'Home', 'Property', '3 bedroom 2 bath|Open Floorplan|Single Story|', 'Home For Sale in Fresno|3 bedroom 2 bath Home For Sale in Fresno|Open Floorplan Home For Sale in Fresno|Single Story Home For Sale in Fresno|3 bedroom 2 bath Open Floorplan Home For Sale in Fresno|3 bedroom 2 bath Single Story Home For Sale in Fresno|Open Floorplan Single Story Home For Sale in Fresno|Property For Sale in Fresno|3 bedroom 2 bath Property For Sale in Fresno|Open Floorplan Property For Sale in Fresno|Single Story Property For Sale in Fresno|3 bedroom 2 bath Open Floorplan Property For Sale in Fresno|3 bedroom 2 bath Single Story Property For Sale in Fresno|Open Floorplan Single Story Property For Sale in Fresno|1120 E. Carnoustie Ave|1120 E. Carnoustie Ave Fresno|1120 E. Carnoustie Ave Fresno CA|1120 E. Carnoustie Ave Fresno CA 93730|', 'true', '2014-08-22 09:05:53');
