(34, 58, '45442 Road 621', 'Ahwahnee', 'Ahwahnee', 'Ahwahnee', 'CA', 'California', '93601', 'Canada', 'Oakhurst Area', 'Residential Acreage', 'Close to Oakhurst and its amenities, yet secluded and private. As you enter down the long driveway to this beautifully well-maintained property, you will be greeted by beautiful majestic trees in the center island. This gorgeous home is perfect for entertaining. Large kitchen and open floor plan flows nicely. Newer, updated flooring in kitchen, dining, den and laundry area. This spacious 3 bedroom, 2 bath home has 2 full living areas plus a bonus den off the dining area. Plenty of room for your growing family and guests! Step outside to the soothing sound of a beautiful waterfall off of the extra large patio. This is a perfect area for your backyard parties with plenty of room for large gatherings. A/C is newer and attic insulation has recently been added. Pest inspection and clearance available.', '424718', 'Close to Oakhurst and it''s Amenities, Yet Secluded and Private|Perfect for Entertaining|Large Kitchen|Spacious 3 bedroom, 2 bath|Bonus Den|Beautiful Waterfall|Pest Clearance Available|Secluded and Private|Extra Large Patio|Newer HVAC|', '3', '2', '2032', 1990, '43,560', 'http://www.greathomesinfresno.com/property/45442-Road-621-Ahwahnee-California', 'Yosemite', 'Yosemite', 'Rivergold', 'Wasuma', 'From Hwy 41 and Hwy 49, North on Hwy 49 to Road 621 to property on the right.', 'https://www.google.com/maps/place/45442+Road+621,+Ahwahnee,+CA+93601/@37.362863,-119.717972,17z/data=!3m1!4b1!4m2!3m1!1s0x80969e6021fc1707:0xe3d12567b0526acb?hl=en', '', 'For Sale', 'Home', 'Property', 'Private|1+ Acre|Short Sale|', 'Home For Sale in Ahwahnee|Private Home For Sale in Ahwahnee|1+ Acre Home For Sale in Ahwahnee|Short Sale Home For Sale in Ahwahnee|Private 1+ Acre Home For Sale in Ahwahnee|Private Short Sale Home For Sale in Ahwahnee|1+ Acre Short Sale Home For Sale in Ahwahnee|Property For Sale in Ahwahnee|Private Property For Sale in Ahwahnee|1+ Acre Property For Sale in Ahwahnee|Short Sale Property For Sale in Ahwahnee|Private 1+ Acre Property For Sale in Ahwahnee|Private Short Sale Property For Sale in Ahwahnee|1+ Acre Short Sale Property For Sale in Ahwahnee|45442 Road 621|45442 Road 621 Ahwahnee|45442 Road 621 Ahwahnee CA|45442 Road 621 Ahwahnee CA 93601|', 'true', '2014-08-22 09:30:52'),
(35, 58, '2882 E. Shea Dr', 'Fresno', 'Fresno', 'Fresno', 'CA', 'California', '93720', 'United States', 'Woodward Park Area', 'Residential Home', 'What a fabulous home! Come see this amazing newer home nestled in a picturesque neighborhood. This home boasts 5 bedrooms, 3 bathrooms, large welcoming floor plan, and a well maintained back yard. One bedroom downstairs with bathroom, so your guests have a place to stay. Pergo flooring throughout the house with custom two tone paint. Take a step out side to your covered patio which keeps you cool on those hot summer days. Perfect for hosting those backyard Bar-B-Qs with family and friends. Location of this great home is ideal with shopping, walking and biking trails, restaurants, and local parks just a few minutes away. Students will attend the award winning schools in Clovis Unified. Come see this beautiful home before its gone!', '427552', '5 Bedroom 3 Bath|Downstairs Bedroom and Full Bath|Laminate Flooring Throughout|Large Covered Patio|Shopping, Trails, Restaurants and Parks Nearby|Clovis Schools|Picturesque Neighborhood|Spacious Upstairs|Nice Custom 2 Tone Paint|Great For Entertaining|', '5', '3', '2,378', 2002, '6,262', 'http://www.greathomesinfresno.com/property/2882-E-Shea-Dr-Fresno-California', 'Clovis Unified School District', 'Clovis North', 'Granite Ridge', 'Riverview', 'From Willow and Perrin, head West on Perrin. First L on Fine Ave., then R on Deyoung Dr. Follow road as it curves into Paul Ave. Make a L of Shea, house is on left end of road.', 'https://www.google.com/maps/place/2882+E+Shea+Dr,+Fresno,+CA+93720/@36.871675,-119.731978,17z/data=!3m1!4b1!4m2!3m1!1s0x80944318309c970d:0x438b4cc88bcf291a?hl=en', 'http://www.greathomesinfresno.com/property/1120-E-Carnoustie-Ave-Fresno-California', 'For Sale', 'Home', 'Property', '5 Bedroom|Picturesque Neighborhood|2 Story|', 'Home For Sale in Fresno|5 Bedroom Home For Sale in Fresno|Picturesque Neighborhood Home For Sale in Fresno|2 Story Home For Sale in Fresno|5 Bedroom Picturesque Neighborhood Home For Sale in Fresno|5 Bedroom 2 Story Home For Sale in Fresno|Picturesque Neighborhood 2 Story Home For Sale in Fresno|Property For Sale in Fresno|5 Bedroom Property For Sale in Fresno|Picturesque Neighborhood Property For Sale in Fresno|2 Story Property For Sale in Fresno|5 Bedroom Picturesque Neighborhood Property For Sale in Fresno|5 Bedroom 2 Story Property For Sale in Fresno|Picturesque Neighborhood 2 Story Property For Sale in Fresno|2882 E. Shea Dr|2882 E. Shea Dr Fresno|2882 E. Shea Dr Fresno CA|2882 E. Shea Dr Fresno CA 93720|', 'true', '2014-08-22 09:56:38'),
(36, 58, '5462 N. Kavanagh Ave', 'Fresno', 'Fresno', 'Fresno', 'CA', 'California', '93711', 'United States', 'Old Fig Garden', 'Residential Home', 'Jewel of the Cul De Sac! This amazing home was built for the original owners who meticulously improved it over the years! Expansive front yard with adobe tile, brick wall and mature trees. Walnut Parquet flooring in entry. Walnut hardwood through out most of the house. Family Room with gas fireplace, built-in entertainment system, high ceilings and French doors. Gourmet kitchen with Corian counters, butcher block, and lots of storage. Office, with built-ins was added with permits by licensed contractor. Master suite with fireplace and cherry wood cabinets has access to secret garden. Master bath redone with beautiful Corian counter, spa tub and cedar lined closets. 2 extra bedrooms have Jack and Jill baths and a powder room. Real wood blinds throughout the house. Surround sound. Backyard is like a mountain retreat with patios, tall trees, adobe tile, pebble tec pool and several entertainment areas! Over 100 pots stay with the house! Treat yourself to this beautiful home.', '426976', 'Cul De Sac Lot|Gourmet Kitchen with Corian Counters|Office|Master Suite with Fireplace and Cherry Wood Cabinets|Master Suite access to Secret Garden|Spa Tub in Master Bath|Cedar Lined Master Closet|Pebble Tec Pool|Jack and Jill Bath with Powder Room|Family Room with Gas Fireplace|', '3', '3', '3,000', 1977, '15,400', 'http://www.greathomesinfresno.com/property/5462-N-Kavanagh-Ave-Fresno-California', 'FUSD', 'Bullard', 'Tenaya', 'Mallach', 'From Barstow and Van Ness, Go West on Barstow, Turn Right on Kavanagh to house.', 'https://www.google.com/maps/place/5462+N+Kavanagh+Ave,+Fresno,+CA+93711/@36.816714,-119.838272,17z/data=!3m1!4b1!4m2!3m1!1s0x8094662b9d2f0665:0xb25c53fc5f7d65a1?hl=en', '', 'For Sale', 'Home', 'Property', 'Pebble Tec Pool|Prime Cul De Sac Lot|Single Story|', 'Home For Sale in Fresno|Pebble Tec Pool Home For Sale in Fresno|Prime Cul De Sac Lot Home For Sale in Fresno|Single Story Home For Sale in Fresno|Pebble Tec Pool Prime Cul De Sac Lot Home For Sale in Fresno|Pebble Tec Pool Single Story Home For Sale in Fresno|Prime Cul De Sac Lot Single Story Home For Sale in Fresno|Property For Sale in Fresno|Pebble Tec Pool Property For Sale in Fresno|Prime Cul De Sac Lot Property For Sale in Fresno|Single Story Property For Sale in Fresno|Pebble Tec Pool Prime Cul De Sac Lot Property For Sale in Fresno|Pebble Tec Pool Single Story Property For Sale in Fresno|Prime Cul De Sac Lot Single Story Property For Sale in Fresno|5462 N. Kavanagh Ave|5462 N. Kavanagh Ave Fresno|5462 N. Kavanagh Ave Fresno CA|5462 N. Kavanagh Ave Fresno CA 93711|', 'true', '2014-08-22 10:48:46'),
(37, 58, '896 E. Catalina Circle', 'Fresno', 'Fresno', 'Fresno', 'CA', 'California', '93730', 'United States', 'Woodward Lake', 'Residential Home', 'This single story delightful 3 Bedroom 2.5 Bath Grupe built home is ready for a quick and traditional sale. You and your clients will be impressed with the many upgrades and loving care this property has to offer. Plenty of natural light comes through the numerous skylights in the large family room (with fireplace). Separate living room that offers views to the covered patio and backyard. Kitchen has plenty of room to prepare and enjoy delightful meals. You''ll stay cool in the summer with the lovely tile floors, ceiling fans in both the bedrooms, kitchen and bath. Additional fans and a/c units help keep energy costs way down. Outdoor living extends the home by offering almost a full kitchen. Built in B.B.Q. burner, and seating area. Tons of additional storage on the outside side yards.', '428952', 'Lots of Natural Light with lots of Skylights|Large Family Room with Fireplace|Formal Living Room with Backyard Views|Tile Floors|Ceiling Fans in Bedrooms, Kitchen and Bath|Outdoor Kitchen with Built in Barbeque|Lots of Storage|Woodward Lake Amenities|Close to Woodward Park, Trails, Shopping and Restaurants|Freeway access nearby|', '3', '2.5', '2,222', 1989, '7,986', 'http://www.greathomesinfresno.com/property/896-E-Catalina-Circle-Fresno-California', 'CUSD', 'Clovis West', 'Kastner', 'Valley Oak', 'From Friant go East on Ft. Washington, left on Brandywine, right on East Shore, left into Catalina Circle. Home is straight ahead.', 'https://www.google.com/maps/place/896+E+Catalina+Cir,+Fresno,+CA+93730/@36.8877669,-119.769047,17z/data=!3m1!4b1!4m2!3m1!1s0x80944266498f33c3:0x8bd97c56662fbc4e?hl=en', 'http://www.greathomesinfresno.com/property/1120-E-Carnoustie-Ave-Fresno-California', 'For Sale', 'Home', 'Property', '3 Bedroom|Woodward Lake|Single Story|', 'Home For Sale in Fresno|3 Bedroom Home For Sale in Fresno|Woodward Lake Home For Sale in Fresno|Single Story Home For Sale in Fresno|3 Bedroom Woodward Lake Home For Sale in Fresno|3 Bedroom Single Story Home For Sale in Fresno|Woodward Lake Single Story Home For Sale in Fresno|Property For Sale in Fresno|3 Bedroom Property For Sale in Fresno|Woodward Lake Property For Sale in Fresno|Single Story Property For Sale in Fresno|3 Bedroom Woodward Lake Property For Sale in Fresno|3 Bedroom Single Story Property For Sale in Fresno|Woodward Lake Single Story Property For Sale in Fresno|896 E. Catalina Circle|896 E. Catalina Circle Fresno|896 E. Catalina Circle Fresno CA|896 E. Catalina Circle Fresno CA 93730|', 'true', '2014-08-22 11:13:32'),
